import {PrismaClient} from "@prisma/client";

const prisma = new PrismaClient();

async function main() {
    const jobs = getJobs();
    await prisma.job.createMany({
        data: jobs.map((job) => ({
            ...job,
            date: new Date(job.date)
        })),
    });
}

main()
    .then(async() => {
        await prisma.$disconnect()
    })
    .catch(async (e) => {
        console.error(e)
        await prisma.$disconnect()
        process.exit(1)
    })

